import React from 'react';
import Qbuttons from './QualitiesButtons/Qbuttons';

export default function Ourqualities() {
  return (
    <div className='container-fluid qualities_container'>
        <div className="row">
            <div className="col-3"><Qbuttons/></div>
            <div className="col-3"><Qbuttons/></div>
            <div className="col-3"><Qbuttons/></div>
            <div className="col-3"><Qbuttons/></div>
        </div>
    </div>
  )
}
